import React, { useState } from "react";
import './play.css'; // Make sure to replace with the correct CSS file

function Quiz3() {
  const [showFinalResults, setFinalResults] = useState(false);
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [score, setScore] = useState(0);
  const [selectedOption, setSelectedOption] = useState(null);
  const question = [
    {
      text: "What is meant by Good touch?",
      options: [
        { id: 0, text: "Feeling comfortable", isCorrect: true },
        { id: 1, text: "safe", isCorrect: false },
        { id: 2, text: "don't feel good", isCorrect: false },
        { id: 3, text: "uneasy", isCorrect: false },
      ],
    },
    {
      text: "What are bad touches?",
      options: [
        { id: 0, text: "don't feel good", isCorrect: true },
        { id: 1, text: "safe", isCorrect: false },
        { id: 2, text: "comfortable", isCorrect: false },
        { id: 3, text: "uneasy", isCorrect: false },
      ],
    },
    {
      text: "What are private parts?",
      options: [
        { id: 0, text: "chest", isCorrect: false },
        { id: 1, text: "under legs", isCorrect: false },
        { id: 2, text: "a and b", isCorrect: true },
        { id: 3, text: "hands", isCorrect: false },
      ],
    },
    {
      text: "What signs indicate bad touch?",
      options: [
        { id: 0, text: "happy", isCorrect: false },
        { id: 1, text: "joyful", isCorrect: false },
        { id: 2, text: "excited", isCorrect: false },
        { id: 3, text: "afraid", isCorrect: true },
      ],
    },
    {
      text: "What does good touch make you feel?",
      options: [
        { id: 0, text: "bad", isCorrect: false },
        { id: 1, text: "feel happy", isCorrect: true },
        { id: 2, text: "angry", isCorrect: false },
        { id: 3, text: "embarrassed", isCorrect: false },
      ],
    },
  ];

  const optionClicked = (isCorrect) => {
    if (selectedOption !== null) {
      if (isCorrect) {
        setScore(score + 1);
      }
      if (currentQuestion + 1 < question.length) {
        setCurrentQuestion(currentQuestion + 1);
        setSelectedOption(null); // Reset selected option for the next question
      } else {
        setFinalResults(true);
      }
    }
  };

  const restartGame = () => {
    setScore(0);
    setCurrentQuestion(0);
    setFinalResults(false);
    setSelectedOption(null);
  };

  return (
    <div className="vid-quiz-app">
      <h1>Good touch and bad touch</h1>

      {showFinalResults ? (
        <div className="vid-quiz-final-result">
          <h1>Final Result</h1>
          <h2>
            {score} out of {question.length} correct - (
            {(score / question.length) * 100}%)
          </h2>
          <button
            className="vid-quiz-restart-button"
            onClick={() => restartGame()}
          >
            Restart Quiz
          </button>
        </div>
      ) : (
        <div className="vid-quiz-questions-card">
          <h2>
            Question {currentQuestion + 1} out of {question.length}
          </h2>
          <h3 className="vid-quiz-question-text">
            {question[currentQuestion].text}
          </h3>

          <form>
            {question[currentQuestion].options.map((option) => (
              <div
                key={option.id}
                className="vid-quiz-radio-option"
                onClick={() => optionClicked(option.isCorrect)}
              >
                <input
                  type="radio"
                  id={`vid-quiz-option-${option.id}`}
                  name={`vid-quiz-option-${currentQuestion}`}
                  checked={selectedOption === option.id}
                  onChange={() => setSelectedOption(option.id)}
                />
                <label htmlFor={`vid-quiz-option-${option.id}`}>
                  {option.text}
                </label>
              </div>
            ))}
          </form>
          <button
            className="vid-quiz-submit-button"
            onClick={() => optionClicked(false)}
          >
            Next
          </button>
        </div>
      )}
    </div>
  );
}

export default Quiz3;
